function Churnd(e){this.project_id=e}Churnd.prototype.project_id="";Churnd.prototype.login=function(e,t){var n={key:this.project_id,email:e,account:t};var r=new XMLHttpRequest;r.open("POST","http://localhost:9292/api/login");r.setRequestHeader("Content-Type","application/json;charset=UTF-8");r.send(JSON.stringify(n));r.onreadystatechange=function(){if(r.readyState==4&&r.status==200){console.log("xhr.readyState=",r.readyState);console.log("xhr.status=",r.status);console.log("response=",r.responseText)}else{console.log(r.statusText)}}};Churnd.prototype.track=function(e,t,n){var r={key:this.project_id,email:e,type:t,account:n};var i=new XMLHttpRequest;i.open("POST","http://localhost:9292/api/track");i.setRequestHeader("Content-Type","application/json;charset=UTF-8");i.send(JSON.stringify(r))};Churnd.prototype.logout=function(e,t){var n={key:this.project_id,email:e,account:t};var r=new XMLHttpRequest;r.open("POST","http://localhost:9292/api/logout");r.setRequestHeader("Content-Type","application/json;charset=UTF-8");r.send(JSON.stringify(n))}